import React from "react";
import withSearch from "./WithSearch";
import { data } from "./Data";

const Services = ({ data, onItemClick }) => {
  return (
    <div>
      <div>Services</div>
      <ul>
        {data.map((item, index) => (
          <li
            key={index}
            onClick={() => onItemClick(item)}
            style={{ cursor: "pointer" }}
          >
            {item}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default withSearch(Services, data);
